import{_ as i,a,o as l,H as o}from"./chunks/framework.Cao6T-Ti.js";const e="/assets/place.BJEPAhhN.jpeg",t="/assets/stand.Ba4JYYm1.jpeg",p="/assets/work.JMS31qxh.jpeg",x=JSON.parse('{"title":"WoodSpace","description":"Столярный коворкинг","frontmatter":{"title":"WoodSpace","description":"Столярный коворкинг","date":"2019-07-21","icon":"logo.png","cover":"space.jpg","city":"г. Санкт-Петербург","place":"м. Нарвская","address":"ул. Трефолева, 1П, завод \\"Красный химик\\"","tel":"+7 (981) 886-06-26","hours":"Пн-СБ — с 9 до 18","instagram":"woodspace.spb","vk":"woodspacespb","url":"https://woodspace.su","email":"diyspb@yandex.ru","coord":[59.88797301611955,30.2829002408159],"status":"open"},"headers":[],"relativePath":"workshop/catalog/woodspace/index.md","filePath":"workshop/catalog/woodspace/index.md"}'),s={name:"workshop/catalog/woodspace/index.md"},r=o('<p>Коворкинг - это модная схема организации рабочего процесса, при которой в одном рабочем пространстве происходят разные, не всегда похожие виды деятельности. Коворкингом также называется и само помещение (офис, столярная мастерская и т. п.), где происходит подобная работа.</p><p>Английское слово Coworking переводится именно как «совместная работа». Идея коворкинга возникла с развитием фриланса, одним из главных недостатков которого является изоляция работающего человека и отсутствие коллектива. Именно эту проблему коворкинг и призван решать.</p><p>А ещё, поскольку коворкинг часто бывает платным, у его сотрудников возникает дополнительная мотивация вкалывать, не просиживая впустую потраченные на аренду рабочего места денежки.</p><h3 id="woodspace-открытая-столярная-мастерская" tabindex="-1">WOODSPACE - открытая столярная мастерская! <a class="header-anchor" href="#woodspace-открытая-столярная-мастерская" aria-label="Permalink to &quot;WOODSPACE - открытая столярная мастерская!&quot;">​</a></h3><p>У нас вы можете:</p><ul><li>Арендовать рабочее место под профессиональные задачи (верстак, инструмент, станки) от 1го часа и до ∞.</li><li>Воспользоваться коворкингом для занятия своим хобби.(творчество,рукоделие,handmade)</li><li>Провести свои мероприятия (Мастер-классы, фотосессия)</li><li>Пройти курсы столярного мастерства.</li><li>Работать над своими проектами в коворкинге с сопровождением мастера.</li></ul><p><img src="'+e+'" alt=""></p><h2 id="наши-инструменты" tabindex="-1">Наши инструменты <a class="header-anchor" href="#наши-инструменты" aria-label="Permalink to &quot;Наши инструменты&quot;">​</a></h2><ol><li>Форматно-раскроечные станок Paoloni ( Италия)</li><li>Фуганок Minimax (Италия)</li><li>Рейсмус Jet</li><li>Фрезерный станок Griggio с автоподатчиком</li><li>Фрезерный станок малый Jet</li><li>Пила циркулярная Metabo</li><li>Калибровочный станок Jet</li><li>Гидравлическая вайма (3 м)</li><li>Пресс вакуумный</li><li>Торцовочные пилы Makita (большая и малая)</li><li>Сверлильный станок</li><li>Пневмооборудование</li><li>Ручной электроинструмент для выполнения полного цикла деревообработки</li></ol><p><img src="'+t+'" alt=""></p><h3 id="лучшии-в-санкт-петербурге-столярныи-коворкинг" tabindex="-1">ЛУЧШИЙ В САНКТ-ПЕТЕРБУРГЕ СТОЛЯРНЫЙ КОВОРКИНГ <a class="header-anchor" href="#лучшии-в-санкт-петербурге-столярныи-коворкинг" aria-label="Permalink to &quot;ЛУЧШИЙ В САНКТ-ПЕТЕРБУРГЕ СТОЛЯРНЫЙ КОВОРКИНГ&quot;">​</a></h3><ul><li><p>ПЛОЩАДЬ КОВОРКИНГА БОЛЕЕ 300 КВ.М. Возможность работы с крупногабаритными изделиями.</p></li><li><p>РАБОТАЕМ 7 ДНЕЙ В НЕДЕЛЮ С 10-00 ДО 19-00 Удобный график посещения гостями коворкинга.</p></li><li><p>ПРОФЕССИОНАЛЬНОЕ ОБОРУДОВАНИЕ Возможность решать задачи любой сложности.</p></li><li><p>АБОНЕМЕНТЫ ПОСТОЯННЫМ КЛИЕНТАМ Гибкая система оплаты</p></li><li><p>ЛУЧШИЕ СПЕЦИАЛИСТЫ У нас работают профессионалы, опыт работы более 20 лет.</p></li><li><p>ЗОНА ХРАНЕНИЯ Возможность хранить материалы, вещи, предметы на нашем складе, ячейках.</p></li><li><p>ЗОНА ОТДЫХА Место, где можно устроить перерыв на чай\\кофе.</p></li><li><p>МАГАЗИН Вы можете приобрести у нас необходимые расходные материалы.</p></li></ul><p><img src="'+p+'" alt=""></p>',13),c=[r];function d(n,_,h,m,u,g){return l(),a("div",null,c)}const k=i(s,[["render",d]]);export{x as __pageData,k as default};
